  `last_login` datetime NOT NULL,
  `date_joined` datetime NOT NULL,
  `status` varchar(2) NOT NULL,
  `is_fake` tinyint(1) NOT NULL,
  `email_isvalid` tinyint(1) NOT NULL,
  `email_key` varchar(32) DEFAULT NULL,
